import React from 'react';
import './App.css';
import Navigation from "./components/Navigation";

const Questions = [
    {
        id : 1,
        title : 'What is Javascript',
        subtitle : 'I need more information about it',
        up : 0,
        answers : []
    },
    {
        id : 2,
        title : 'How to do map() function',
        subtitle : 'Can someone tell how to do it step by step',
        up : 0,
        answers : []
    },{
        id : 3,
        title : 'MongoDB or firebase?',
        subtitle : 'Cant decide...',
        up : 4,
        answers : []
    },{
        id : 4,
        title : 'Any good tutorials for ES6',
        subtitle : 'Want to start practice, but dunno where',
        up : 0,
        answers : []
    }
]


function App() {
  return (
    <div className="App">
        <Navigation />
      <h1>Welcome to developers Q/A Community!</h1>
      <p>Feel free to help or get help for/from community members!</p>
    </div>
  );
}

export default App;
